tables.table_schema:
CREATE TABLE EnergyDemandData (
    timestamp TIMESTAMP,
    location VARCHAR(255),
    demand_kW DECIMAL
);

CREATE TABLE EnergyDemandData (
    id SERIAL PRIMARY KEY,
    timestamp TIMESTAMP,
    demand_value DECIMAL
);

CREATE TABLE GridOperators (
    operator_id SERIAL PRIMARY KEY,
    operator_name VARCHAR(50),
    location VARCHAR(100)
);

CREATE TABLE Smart_Grid_Operators (
    grid_operator_id SERIAL PRIMARY KEY,
    operator_name VARCHAR(50) NOT NULL,
    location VARCHAR(100) NOT NULL
);

CREATE TABLE Energy_Demand_Data (
    demand_id SERIAL PRIMARY KEY,
    timestamp TIMESTAMP NOT NULL,
    demand_value FLOAT NOT NULL,
    grid_operator_id INTEGER REFERENCES Smart_Grid_Operators(grid_operator_id)
);

CREATE TABLE Distribution_Efficiency (
    efficiency_id SERIAL PRIMARY KEY,
    efficiency_rating FLOAT NOT NULL,
    timestamp TIMESTAMP NOT NULL,
    grid_operator_id INTEGER REFERENCES Smart_Grid_Operators(grid_operator_id)
);

CREATE TABLE EnergyDemandData ( 
    id INT PRIMARY KEY, 
    timestamp TIMESTAMPTZ NOT NULL, 
    location_id INT NOT NULL, 
    demand FLOAT NOT NULL 
);

CREATE TABLE Locations ( 
    id INT PRIMARY KEY, 
    name VARCHAR(255) NOT NULL, 
    latitude FLOAT NOT NULL, 
    longitude FLOAT NOT NULL 
);

CREATE TABLE Operators ( 
    id INT PRIMARY KEY, 
    name VARCHAR(255) NOT NULL, 
    email VARCHAR(255) NOT NULL, 
    phone VARCHAR(20) 
);

CREATE TABLE DistributionData ( 
    id INT PRIMARY KEY, 
    timestamp TIMESTAMPTZ NOT NULL, 
    location_id INT NOT NULL, 
    capacity FLOAT NOT NULL 
);

CREATE TABLE AnalysisResults ( 
    id INT PRIMARY KEY, 
    timestamp TIMESTAMPTZ NOT NULL, 
    location_id INT NOT NULL, 
    analysis_result JSONB NOT NULL 
);
